import React from 'react'
import { Button } from '@mui/material'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import myLogo from "../myPortfolio/pngsp1.png"

const Portfolio = () => {
  return (
    <>
    
    <Navbar bg="light" variant="light">
    <Container>
      <Navbar.Brand href="#home"><img src={myLogo} alt={myLogo} width="130px"></img></Navbar.Brand>
      <Nav className="me-10px">
      <Button variant="outlined" margin-left="130px">Home</Button>
      <Button variant="outlined" margin-left="10px">About</Button>
      <Button variant="outlined" justifyContent="space-between">Contact</Button>
      </Nav>
    </Container>
  </Navbar>
    </>
  )
}

export default Portfolio
